import Style from "ol/style/Style";
import Stroke from "ol/style/Stroke";
import Fill from "ol/style/Fill";
import { FeatureLike } from "ol/Feature";
import { MapUtils } from "./MapUtils";

export const fillOpacity: number = 0.75;

export function defaultStyle(feature: FeatureLike): Style {
    let style: Style = new Style({
        fill: new Fill({
            color: getFillColor(feature.get('count')),
        }),
        stroke: new Stroke({
            color: getFillColor(feature.get('count')),
        })
    });
    return style;
}

function getFillColor(d: number[]) {
    return d[0] > 430  ? `rgba(179,0,0,${fillOpacity})` :
           d[1] > 350  ? `rgba(227,74,51,${fillOpacity})` :
           d[2] > 270  ? `rgba(252,141,89,${fillOpacity})` :
           d[3] > 190   ? `rgba(253,187,132,${fillOpacity})` :
           d[4] > 110   ? `rgba(253,212,158,${fillOpacity})` :
           d[5] > 30   ? `rgba(254,240,217,${fillOpacity})` :
                      `rgba(180,180,180,${fillOpacity})`;
}

export const getClasses = () => {
    MapUtils.getGeojson('http://localhost:8000/range')
        .then(data => getFillColor(data));
}
